I thought it was a feature request (wdlDependencies isn't a documented field for batch endpoint in the README.md) but if you're expecting that it should work, then it's a bug report - because if I submit to `:version/batch` specifying `wdlDependencies`: ; ```; curl http://bionode05/cromwell/api/workflows/V1/batch -FwdlSource=@test.wdl -FworkflowInputs=@test.batch.inputs -FwdlDependencies=@dependency.wdl.zip; ```; I get a failed workflow with the following metadata (no `imports` in the `submittedFiles` block):; ```; {; "submittedFiles": {; "inputs": "{"test.foo.showIt":"that"}",; "workflow": "import "dependency.wdl" as dependency

workflow test {

	call dependency.foo

}
",; "options": "{

}"; },; "calls": {. },; "outputs": {. },; "id": "d97a5124-0933-4243-b542-6467b496ba22",; "inputs": {. },; "submission": "2016-12-08T10:21:10.205+10:00",; "status": "Failed",; "failures": [{; "message": "Workflow input processing failed.
Unable to load namespace from workflow: Failed to import workflow, no import sources provided."; }],; "end": "2016-12-08T10:21:16.957+10:00",; "start": "2016-12-08T10:21:16.952+10:00"; }; ```. The exact same `curl` command line submission (with suitable inputs file) but to the `:version` endpoint works ok.

Seen on Cromwell 26-c14e64d. Reported to us as GAWB-1867. Here's a WDL:. ```; task HelloTask; 	{; 	File InFile; 	command; 		{; 		echo "A file is here !" ;; 		echo "Here is the ls" ;; 		ls -alh * ; 		ls -alht ${InFile} ; 		head ${InFile}; 		}; 	output; 		{; 		}; 	meta {author : "Eddie Salinas"}; 	runtime { docker: "eddiebroad/public_test_dsdeepb_2332" }; 	}; 	; workflow HelloWorkflow; 	{; 	File InFile; 	call HelloTask; 		 {; 		input:InFile=InFile; 		}; 	}; ```. If I accidentally pass an empty string to the input, the job stays running indefinitely:. ```; {; "workflowName": "HelloWorkflow",; "submittedFiles": {; "inputs": "{"HelloWorkflow.InFile":""}",; "workflow": "task HelloTask
