Still looking at a Centaur test for this but I thought I'd let the seafowl have at it. Metadata looks like:. ```; {; "workflowName": "three_step",; "submittedFiles": {; "workflow": "import "3step-tasks.wdl" as tasks
import "https://raw.githubusercontent.com/broadinstitute/centaur/591beaf8422af7c3faf51e437a91d94d13b76eba/src/main/resources/standardTestCases/aliased_subworkflows/subworkflow.wdl" as subworkflow


workflow three_step {
 call tasks.ps as ps
 call tasks.cgrep as cgrep {
 input: in_file = ps.procs
 }
 call tasks.wc as wc {
 input: in_file = ps.procs
 }
 output {
 cgrep.*
 wc.*
 }
}
",; "workflowType": "WDL",; "options": "{

}",; "inputs": "{"three_step.cgrep.pattern":"mcovarr"}",; "labels": "{}",; "imports": {; "https://raw.githubusercontent.com/broadinstitute/centaur/591beaf8422af7c3faf51e437a91d94d13b76eba/src/main/resources/standardTestCases/aliased_subworkflows/subworkflow.wdl": "task increment {
 Int i
 command {
 echo $(( ${i} + 1 ))
 }
 output {
 Int j = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

workflow subwf {
 Array[Int] is
 scatter (i in is) {
 call increment { input: i = i }
 }
 output {
 Array[Int] js = increment.j
 }
}
",; "3step-tasks.wdl": "task ps {
 command {
 ps
 }
 output {
 File procs = stdout()
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

task cgrep {
 String pattern
 File in_file
 command {
 grep '${pattern}' ${in_file} | wc -l
 }
 output {
 Int count = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

task wc {
 File in_file
 command {
 cat ${in_file} | wc -l
 }
 output {
 Int count = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

"; }; },; .; .; .; ```. So the http imports come in under "submittedFiles" which is maybe a little weird. But other options would have http imports either not being next to the file imports and/or having to change the metadata schema.

The error messages from Cromwell when it can't find input files are opaque:. Response body:; {; "status": "error",; "message": "404 Not Found
{
 "code" : 404,
 "errors" : [ {
 "domain" : "global",
 "message" : "Not Found",
 "reason" : "notFound"
 } ],
 "message" : "Not Found"
}"; } . Response header:; {; "Date": "Fri, 18 Nov 2016 21:15:39 GMT",; "Server": "spray-can/1.3.2",; "X-Frame-Options": "SAMEORIGIN",; "Access-Control-Max-Age": "1728000",; "Access-Control-Allow-Methods": "GET,POST,PUT,PATCH,DELETE,OPTIONS,HEAD",; "Content-Type": "application/json; charset=UTF-8",; "Access-Control-Allow-Origin": "*",; "Access-Control-Expose-Headers": "Link",; "Connection": "close",; "Access-Control-Allow-Headers": "authorization,content-type,accept,origin",; "Content-Length": "232"; } ```. Response Code: 500. It would be very helpful if it could specify what files are missing.

We are trying to abort a job in FireCloud using cromwell .21. The workflow appears stuck in submitted state. It appears to have no calls. Is there are race condition that is we abort too soon the job is stuck?. ```; ~/projects/rawls [develop*] $ curl -H "Authorization: Bearer `gcloud auth print-access-token`" https://cromwell2.dsde-alpha.broadinstitute.org/api/workflows/v1/b29c0ef3-e988-4d70-8093-bdd1a039170d/status; {; "status": "Submitted",; "id": "b29c0ef3-e988-4d70-8093-bdd1a039170d"; }(dvoet@wm163-585) 14:55; ~/projects/rawls [develop*] $ curl -H "Authorization: Bearer `gcloud auth print-access-token`" https://cromwell2.dsde-alpha.broadinstitute.org/api/workflows/v1/b29c0ef3-e988-4d70-8093-bdd1a039170d/metadata; {; "submittedFiles": {; "inputs": "{"test.hello.name":"subject_HCC1143"}",; "workflow": "task hello {
